import React, { useState } from "react";
import "./Galery.css";

function GaleriaDeImagens() {
  const [novaImagemUrl, setNovaImagemUrl] = useState("");
  const [imagens, setImagens] = useState([
    "data:image/jpeg;base64,",

    "data:image/jpeg;base64,",

    "data:image/jpeg;base64,",

    "data:image/jpeg;base64,",

    "data:image/jpeg;base64,",
  ]);

  const adicionarImagem = () => {
    if (novaImagemUrl) {
      setImagens([...imagens, novaImagemUrl]);
      setNovaImagemUrl("");
    }
  };

  return (
    <main>
      <header>
        <h2>
          <i class="ri-image-circle-fill"></i> Galeria de Imagens
        </h2>
        <div>
          <input
            type="text"
            value={novaImagemUrl}
            onChange={(e) => setNovaImagemUrl(e.target.value)}
            placeholder="Digite a URL da imagem"
          />
          <button onClick={adicionarImagem}>
            <i class="ri-upload-2-line"></i>
          </button>
        </div>
      </header>

      <div className="ImagesContainer">
        {imagens.map((imagem, index) => (
          <img
            className="Image"
            key={index}
            src={imagem}
            alt={`Imagem ${index + 1}`}
          />
        ))}
      </div>
    </main>
  );
}

export default GaleriaDeImagens;
